struct GooCallback 
{
   P func;
   P data;
};




struct GooCallback *goo_createCallback(P func, P data)
{
  struct GooCallback *callback;

  callback = (struct GooCallback *)malloc(sizeof(struct GooCallback));
  callback->func = func;
  callback->data = data;

  return callback;
}

void goo_destroyCallback(struct GooCallback *callback)
{
  free(callback);
}



int magicGtkFunctionCallback(gpointer data)
{
  DEFCREGS();	

  struct GooCallback *callback = (struct GooCallback *)data;

  XCALL1(0, callback->func, callback->data);

  return 1;
}

void magicGtkCallback(GtkWidget *widget, gpointer data)
{
  DEFCREGS();

  struct GooCallback *callback = (struct GooCallback *)data;

  XCALL1(0, callback->func, callback->data);
}

void magicGtkCallthrough(GtkWidget *widget, gpointer data)
{
  DEFCREGS();

  struct GooCallback *callback = (struct GooCallback *)data;

  XCALL2(0, callback->func, YPlb((P)widget), callback->data);
}


void magicEventCallback(GtkWidget *widget, gpointer event, gpointer data)
{
  DEFCREGS();

  P _widget, _event;

  struct GooCallback *callback = (struct GooCallback *)data;
 
  _widget = (P)YPlb((P)widget);
  _event  = (P)YPlb((P)event);

  XCALL3(0, callback->func, callback->data, _widget, _event);
}

int magicBoolEventCallback(GtkWidget *widget, gpointer event, gpointer data)
{
  DEFCREGS();

  P _widget, _event;

  struct GooCallback *callback = (struct GooCallback *)data;
 
  _widget = (P)YPlb((P)widget);
  _event  = (P)YPlb((P)event);

  return (XCALL3(0, callback->func, callback->data, _widget, _event) == YPtrue);
}



void *gtk_getGtkFunctionCallback(void)
{
  return magicGtkFunctionCallback;
}

void *gtk_getGtkCallback(void)
{
  return magicGtkCallback;
}

void *gtk_getGtkCallthrough(void)
{
  return magicGtkCallthrough;
}

void *gtk_getEventCallback(void)
{
  return magicEventCallback;
}

void *gtk_getBoolEventCallback(void)
{
  return magicBoolEventCallback;
}




#undef gtk_signal_lookup

guint gtk_signal_lookup(gchar *name, GType itype)
  {
    return g_signal_lookup(name, itype);
  }

#undef gtk_signal_name
gchar *gtk_signal_name(guint id)
  {
    return g_signal_name(id);
  }

#undef gtk_signal_emit_stop
void	gtk_signal_emit_stop(gpointer object,guint id)
  {
    g_signal_stop_emission(object, id, 0);
  }

#undef gtk_signal_connect
gulong	gtk_signal_connect(GtkObject *object, gchar *name, GtkSignalFunc func, gpointer data)
  {
    return gtk_signal_connect_full((object), (name), (func), 0, (data), 0, 0, 0);
  }

#undef gtk_signal_connect_after
gulong	gtk_signal_connect_after(GtkObject *object,gchar *name,GtkSignalFunc func,gpointer data)
  {
    return gtk_signal_connect_full((object), (name), (func), 0, (data), 0, 0, 1);
  }

#undef gtk_signal_connect_object
gulong	gtk_signal_connect_object(GtkObject *object,gchar *name,GtkSignalFunc func,gpointer dataobj)
  {
    return gtk_signal_connect_full((object), (name), (func), 0, (dataobj), 0, 1, 0);
  }

#undef gtk_signal_connect_object_after
gulong	gtk_signal_connect_object_after(GtkObject *object,gchar *name,GtkSignalFunc func,gpointer dataobj)
  {
    return gtk_signal_connect_full((object), (name), (func), 0, (dataobj), 0, 1, 1);
  }

#undef gtk_signal_disconnect
void	gtk_signal_disconnect(gpointer object,gulong id)
  {
    g_signal_handler_disconnect((object), (id));
  }

#undef gtk_signal_handler_block
void	gtk_signal_handler_block(gpointer object,gulong id)
  {
    g_signal_handler_block((object), (id));
  }

#undef gtk_signal_handler_unblock
void	gtk_signal_handler_unblock(gpointer object,gulong id)
  {
    g_signal_handler_unblock((object), (id));
  }

#undef gtk_signal_disconnect_by_func
void	gtk_signal_disconnect_by_func(GtkObject *object,GtkSignalFunc func,gpointer data)
  {
    gtk_signal_compat_matched((object), (func), (data), G_SIGNAL_MATCH_FUNC | G_SIGNAL_MATCH_DATA, 0);
  }

#undef gtk_signal_disconnect_by_data
void	gtk_signal_disconnect_by_data(GtkObject *object,gpointer data)
  {
    gtk_signal_compat_matched((object), 0, (data), G_SIGNAL_MATCH_DATA, 0);
  }

#undef gtk_signal_handler_block_by_func
void	gtk_signal_handler_block_by_func(GtkObject *object,GtkSignalFunc func,gpointer data)
  {
    gtk_signal_compat_matched((object), (func), (data), G_SIGNAL_MATCH_FUNC | G_SIGNAL_MATCH_DATA, 1);
  }

#undef gtk_signal_handler_block_by_data
void	gtk_signal_handler_block_by_data(GtkObject *object,gpointer data)
  {
    gtk_signal_compat_matched((object), 0, (data), G_SIGNAL_MATCH_DATA, 1);
  }

#undef gtk_signal_handler_unblock_by_func
void	gtk_signal_handler_unblock_by_func(GtkObject *object,GtkSignalFunc func,gpointer data)
  {
    gtk_signal_compat_matched((object), (func), (data), G_SIGNAL_MATCH_FUNC | G_SIGNAL_MATCH_DATA, 2);
  }

#undef gtk_signal_handler_unblock_by_data
 void	gtk_signal_handler_unblock_by_data(GtkObject *object,gpointer data)
 {
   gtk_signal_compat_matched((object), 0, (data), G_SIGNAL_MATCH_DATA, 2);
 }

#undef gtk_signal_handler_pending
gboolean gtk_signal_handler_pending(GtkObject *object,guint id,gboolean may_be_blocked)
  {
    return g_signal_has_handler_pending ((object), (id), 0, (may_be_blocked));
  }

#undef gtk_signal_handler_pending_by_func
gulong	gtk_signal_handler_pending_by_func(GtkObject *object,guint signal_id,gboolean may_be_blocked,GtkSignalFunc func,gpointer data)
 {
   return (g_signal_handler_find ((object), G_SIGNAL_MATCH_ID |
                                     G_SIGNAL_MATCH_FUNC |
                                     G_SIGNAL_MATCH_DATA |
                                     ((may_be_blocked) ? 0 : G_SIGNAL_MATCH_UNBLOCKED),
				  (signal_id), 0, 0, (func), (data)) != 0);
 }
 

